import React from 'react';
import RenderImageForMetaElements from '../RenderImageForMetaElements/RenderImageForMetaElements'









const CategoryElement = props => {

    const RenderImage = ()=>{
        if (props.imageUrl){
            return (
                <img src={props.imageUrl}/>
            )
        }else if (!props.imageUrl&& props.noImageUrl){
            return (
                <img src={props.noImageUrl}/>
            )
        }else{
            return (
                <img src='/static/images/noImage/no-image-available.png'/>
            )
        }
    }
    return (
        <div className='category-item'>
        
            <RenderImageForMetaElements {...props}/>
            <p>{ props.name }</p>
        </div>
    );
};
export default CategoryElement;
